import React from 'react'
import styled from 'styled-components'

const Nav = styled.nav`
    background-color: black;
    height: 60px;
    display: flex;
    justify-content: space-between;
    padding: 1rem 2rem;  
    position: fixed;
    width: 100%;
    cursor: pointer;
`

const NavBar = ()=>{
    return(
        <Nav>
            NavBar

        </Nav>
    )
}
export default NavBar
